def drugPotency(loss, expire):
    # your code here
    effectiveness = float(100.00)
    percent_loss=float(loss/100)
    month = 0
    while effectiveness >= expire:
        print("Month: ", month,"  ", "effectiveness: ", effectiveness)
        effectiveness = effectiveness - (effectiveness*percent_loss)
        month += 1
    else:
        print("Month: ", month,"  ", "effectiveness: ", effectiveness, "DISCARDED")
    return effectiveness

def main():
    drugPotency(4.0, 50.0)

if __name__ == "__main__":
    main()

